import React, { useEffect, useState } from "react";
import '../Components/Resume.css'
import MyResume from '../Images/MyResume2023.pdf'

export default function Resume() {
    const [text, setText] = useState("");
    const resumeText = "Welcome to my resume! I am a skilled professional with expertise in..."

    useEffect(() => {
        let currentIndex = 0;
        const intervalId = setInterval(() => {
            if (currentIndex === resumeText.length) {
                clearInterval(intervalId);
            } else {
                setText(resumeText.slice(0, currentIndex + 1));
                currentIndex++;
            }
        }, 100);

        return () => {
            clearInterval(intervalId);
        };
    }, []);


    return(
        <div className="resume">
            <h1 className="resume-title">My Resume</h1>
            <p className="typing-effect">{text}</p>
            <iframe src={MyResume} title="My Resume" className="resume-pdf"></iframe>
        </div>
    )
}
